import React from 'react';
import Todos from './components/Todos/Todos';
import Weather from './components/Weather/Weather';
/**
 * @returns {JSX.Element} The rendered component.
 */
function App() {
  const city = "Ashland";
  return (
    <div className='app-container'> {/* className important */}
      <section className='todos-container'> {/* Changed className */}
        <header>
          <h1>To-Do List</h1>
        </header>
        <Todos />
      </section>
      <section className='weather-container'> {/* Changed className */}
        <Weather city={city} />
      </section>
    </div>
  );
}

export default App;
